  };
  return (
    <div className="galeria grid-columns-5 p-3">
      {fotos.map((item) => (
        <Card
          descripcion={item.alt}
          background={item.src.original}
          key={item.id}
          id={item.id}
        />
      ))}
    </div>
  );
}
